  constants_ro.put('mapHelp', '<div class="helpControls"><h2>Navigarea pe hart\u0103<\/h2><div><img src="$URL{panS}" class="rightImg"/><h3>Consol\u0103 de panoramare<\/h3>Consola de panoramare v\u0103 permite deplasarea pe hart\u0103 la o \xEEn\u0103l\u021Bime fix\u0103.  Face\u021Bi clic \u0219i glisa\u021Bi pentru a v\u0103 deplasa continuu. Cu c\xEEt mai departe de centru glisa\u021Bi, cu at\xEEt mai repede v\u0103 ve\u021Bi deplasa.<\/div><div><img src="$URL{rotateS}" class="rightImg"/><h3> Consola camerei<\/h3> Consola camerei deplaseaz\u0103 doar vederea camerei. Face\u021Bi clic \u0219i glisa\u021Bi pentru a schimba vederea camerei. Cu c\xEEt mai departe de centru glisa\u021Bi, cu at\xEEt mai repede ve\u021Bi schimba vederea.<\/div><div><img src="$URL{zoomS}" class="rightImg"/><h3>Butoane de panoramare<\/h3>F\u0103c\xEEnd clic pe acestea se va schimba \xEEn\u0103l\u021Bimea camerei. Butonul plus va deplasa camera mai aproape de p\u0103m\xEEnt, butonul minus va \xEEndep\u0103rta camera.<\/div><\/div>');
  constants_ro.put('mouseHelp', '<div class="helpControls"><h2>Navigarea cu ajutorul mouse-ului<\/h2><div><img src="$URL{mLeft}" class="rightImg" style="opacity: .5"/><h3>Buton st\xEEnga<\/h3>Face\u021Bi clic \u0219i glisa\u021Bi folosind butonul st\xEEnga al mouse-ului  pentru a se deplasa pe hart\u0103 la o \xEEn\u0103l\u021Bime fix\u0103.<\/div><div><img src="$URL{mRight}" class="rightImg" style="opacity: .5"/><h3>Buton dreapta<\/h3>Clic dreapta \u0219i glisa\u021Bi <b>up/down<\/b> pentru a schimba \xEEn\u0103l\u021Bimea camerei. Clic dreapta \u0219i glisa\u021Bi <b>left/right<\/b> pentru a roti vederea camerei.<\/div><div><img src="$URL{mCenter}" class="rightImg" style="opacity: .5"/><h3>Butonul din mijloc/roti\u0163a<\/h3>Derula\u0163i roti\u0163a pentru a schimba \xEEn\u0103l\u021Bimea camerei (asemenea clic dreapta + glisa\u021Bi \xEEn sus / jos). Clic dreapta \u0219i glisa\u021Bi butonul roti\u021Bei pentru a schimba unghiul camerei.<\/div><\/div>');
  constants_sr_Latn_ME = new HashMap;
  this.entries.put('sr_Latn_ME', constants_sr_Latn_ME);
  constants_sr_Latn_ME.put('keyboardHelp', '<div class="helpControls"><h2>Navigacija tipkovnicom<\/h2><div><img src="$URL{arrows}" class="rightImg"/><h3>Strelice<\/h3>Strelice se koriste za pomeranje kamere po horizontalnoj ravni.<\/div><div><img src="$URL{shift}" class="rightImg"/><h3>SHIFT + strelice<\/h3>Strelice uz pritisnutu dirku SHIFT koriste se za promenu pogleda kamere.<\/div><div><img src="$URL{pgUp}" class="rightImg"/><h3>Strana gore/Strana dole<\/h3>Dirke <b>PG UP i PG DN<\/b> koriste se za promenu visine kamere (jednako kombinaciji desno dugme na mi\u0161u i njegovo pomeranje u pravcu gore/dole).<\/div><\/div>');
  constants_sr_Latn_ME.put('mapHelp', '<div class="helpControls"><h2>Navigacija mapom<\/h2><div><img src="$URL{panS}" class="rightImg"/><h3>Konzola za pomeranje<\/h3>Prva konzola omogu\u0107ava pomeranje kamere po horizontalnoj ravni. Za pomeranje kliknite i prevucite mi\u0161. Brzina pomeranja kamere uve\u0107ava se udaljeno\u0161\u0107u od sredi\u0161ta konzole.<\/div><div><img src="$URL{rotateS}" class="rightImg"/><h3>Konzola za kameru<\/h3>Druga konzola omogu\u0107ava promenu pogleda kamere. Za promenu pogleda kliknite i prevucite mi\u0161. Brzina promene pogleda uve\u0107ava se udaljeno\u0161\u0107u od sredi\u0161ta konzole.<\/div><div><img src="$URL{zoomS}" class="rightImg"/><h3>Dugmad za zumiranje<\/h3>Dugmad se koristi za promenu visine kamere. Dugme plus pomera kameru bli\u017Ee povr\u0161ini, dok dugme minus kameru pomera od povr\u0161ine.<\/div><\/div>');
  constants_sr_Latn_ME.put('mouseHelp', '<div class="helpControls"><h2>Navigacija mi\u0161em<\/h2><div><img src="$URL{mLeft}" class="rightImg" style="opacity: .5"/><h3>Lijevo dugme<\/h3>Kliknite levo dugme na mi\u0161u i prevucite ga za pomeranje po horizontalnoj ravni.<\/div><div><img src="$URL{mRight}" class="rightImg" style="opacity: .5"/><h3>Desno dugme<\/h3>Kliknite desno dugme na mi\u0161u i prevucite ga u pravcu <b>gore/dole<\/b> za promenu visine kamere odnosno u pravcu <b>levo/desno<\/b> za promenu pogleda kamere.<\/div><div><img src="$URL{mCenter}" class="rightImg" style="opacity: .5"/><h3>Srednje dugme/kota\u010Di\u0107/<\/h3>Zakotrljajte kota\u010Di\u0107 za promenu visine kamere (jednako kombinaciji desno dugme na mi\u0161u i njegovo pomeranje u pravcu gore/dole). Kliknite srednje dugme na mi\u0161u i prevucite ga za rotiranje pogleda kamere.<\/div><\/div>');
